+ (UIImage*)exportImage:(UIImage*)image
{
    if (g_imgPixel==NULL) {
        return image;
    }
    CGImageRef img=[image CGImage];
    CGSize sizeReal = CGSizeMake(CGImageGetWidth(img), CGImageGetHeight(img));
    int w = sizeReal.width;
    int h = sizeReal.height;
    unsigned char *datatmp=malloc(w*h*4);
    memcpy(datatmp, g_imgPixel, w*h*4);
    UIImage *resultImage = initImageWithPixel(datatmp, w, h);
    [RCGPUImageDaubFilter releaseImgPixel];
    return resultImage;
}

+ (unsigned char *)daubImg:(UIImage *)image PointOld:(CGPoint)pointOld PointNew:(CGPoint)pointNew Brush:(NSInteger)brushW BrushModle:(float*)brushModel BrushModelW:(int)brushModelW BrushModelH:(int)brushModelH BrushCh:(float)brushCh;
{
    CGImageRef img=[image CGImage];
    CGSize sizeReal = CGSizeMake(CGImageGetWidth(img), CGImageGetHeight(img));
    int w = sizeReal.width;//image.size.width;
    int h = sizeReal.height;//image.size.height;
    float fbrushW=brushW/100.0*brushCh;

    
    
    if (g_imgPixel == NULL)
    {
        return NULL;
    }

    //if (w>200)//é¿åå°å¾é®é¢ï¼æ­£å¼çè¦å é¤
    {
        
    
    
    
    float len=sqrtf((pointNew.y-pointOld.y)*(pointNew.y-pointOld.y)+(pointNew.x-pointOld.x)*(pointNew.x-pointOld.x));
        
    float cosQ;
    float sinQ;
    if (len==0)
    {
        cosQ=1.0;
        sinQ=0.0;
    }
    else
    {
        cosQ=(pointNew.x-pointOld.x)/len;
        sinQ=(pointNew.y-pointOld.y)/len;
    }

    int mW,mH,halfmW,halfmH;
    int xc,yc;
//    mW=w*0.8125*fbrushW;
//    mH=h*0.8125*fbrushW;
        mW=w*0.65*fbrushW;
        mH=h*0.65*fbrushW;
        
    halfmW=brushModelW/2;
    halfmH=brushModelH/2;
    int i,j;
    int tmp=pointNew.y*w*channel+pointNew.x*channel;
    unsigned char tmpR=g_imgPixel[tmp];
    unsigned char tmpG=g_imgPixel[tmp+1];
    unsigned char tmpB=g_imgPixel[tmp+2];
    tmp=pointNew.y*w*channel+pointNew.x*channel;

    double dtmpmid=MIN(brushModelW*1.0/mW, brushModelW*1.0/mH);
        
    int tmpmW=brushModelW/dtmpmid;
    int tmpmH=brushModelH/dtmpmid;
    int l=(int)(sqrt(tmpmW*tmpmW+tmpmH*tmpmH)/2.0+0.5);
    int left,right,top,bottom;
    left=MAX(pointNew.x-l,0)-pointNew.x;
    right=MIN(pointNew.x+l,w-1)-pointNew.x;
    top=MAX(pointNew.y-l,0)-pointNew.y;
    bottom=MIN(pointNew.y+l, h-1)-pointNew.y;
    for (i=top; i<=bottom; i++)
    {
        for (j=left; j<=right; j++)
        {
            xc=(int)(j*cosQ+i*sinQ+0.5);
            yc=(int)(i*cosQ-j*sinQ+0.5);
            yc=yc*dtmpmid;
            xc=xc*dtmpmid;
            if (xc<halfmW&&xc>-halfmW&&yc<halfmH&&yc>-halfmH)
            {
                yc+=halfmH;
                xc+=halfmW;
                float fProportion=brushModel[yc*brushModelW+xc];
                //fProportion=1.0;
                unsigned char *pimg=&g_imgPixel[(int)(i+pointNew.y+0.5)*w*channel+(int)(j+pointNew.x+0.5)*channel];
                *pimg=(*pimg)*(1.0-fProportion)+tmpR*fProportion;
                *(pimg+1)=(*(pimg+1))*(1.0-fProportion)+tmpG*fProportion;
                *(pimg+2)=(*(pimg+2))*(1.0-fProportion)+tmpB*fProportion;
                *(pimg+3)=255;
            }
        }
    }
        
    }
    
    return g_imgPixel;
}

int eraserLine(unsigned char* src, int width, int height, int channels,
               int x1Idx, int y1Idx, int x2Idx, int y2Idx, int radius)	//int*coordinatesList,int listLen
{
    if (src == 0 || width <= 0 || height <= 0)
        return -1;
    if (channels != 4)
        return -1;
    int startXpos, startYpos, endXpos, endYpos;
    if (x1Idx == x2Idx && y1Idx == y2Idx)
    {
        startXpos = x1Idx;
        endXpos = x2Idx;
        startYpos = y1Idx;
        endYpos = y2Idx;
        for (int i = startYpos - radius; i < endYpos + radius; i++)
        {
            for (int j = startXpos - radius; j < endXpos + radius; j++)
            {
                if (sqrt(
                         ((j - x1Idx) * (j - x1Idx) + (i - y1Idx) * (i - y1Idx)))
                    < radius)
                {
                    src[(i * width + j) * channels + 3] = 0;
//                    src[(i * width + j) * channels] = 255;
//                    src[(i * width + j) * channels + 1] = 255;
//                    src[(i * width + j) * channels + 2] = 255;
                }
                
                //src[(i * width + j) * channels + 3] = 255;
            }
        }
    }
    else
    {
        float denominator = sqrt(
                                 (y2Idx - y1Idx) * (y2Idx - y1Idx)
                                 + (x1Idx - x2Idx) * (x1Idx - x2Idx));
        
        if (x1Idx < x2Idx) {
            startXpos = x1Idx;
            endXpos = x2Idx;
        } else {
            startXpos = x2Idx;
            endXpos = x1Idx;
        }
        if (y1Idx < y2Idx) {
            startYpos = y1Idx;
            endYpos = y2Idx;
        } else {
            startYpos = y2Idx;
            endYpos = y1Idx;
        }
        //float
        
        for (int i = startYpos - radius; i < endYpos + radius; i++)
        {
            for (int j = startXpos - radius; j < endXpos + radius; j++)
            {
                if (sqrt(
                         ((j - x1Idx) * (j - x1Idx) + (i - y1Idx) * (i - y1Idx)))
                    < radius
                    || sqrt(
                            ((j - x2Idx) * (j - x2Idx)
                             + (i - y2Idx) * (i - y2Idx))) < radius
                    || (abs(
                            (y2Idx - y1Idx) * j + (x1Idx - x2Idx) * i
                            - x1Idx * y2Idx + x2Idx * y1Idx)
                        / denominator < radius
                        && fabs((y2Idx - y1Idx) * j + (x2Idx - x1Idx) * i - (y2Idx * y2Idx - y1Idx * y1Idx)/ 2.0 - (x2Idx * x2Idx - x1Idx * x1Idx)
                               / 2.0) / denominator
                        < denominator / 2.0))
                {
//                    src[(i * width + j) * channels] = 255;
//                    src[(i * width + j) * channels + 1] = 255;
//                    src[(i * width + j) * channels + 2] = 255;
                    src[(i * width + j) * channels + 3] = 0;
                }
                
                //src[(i * width + j) * channels + 3] = 255;
            }
        }
    }
    
    return 0;
}

