        int ntmpy1,ntmpx1,ntmpxy;
        ntmpx1=(x1Idx - x2Idx);
        ntmpy1=(y2Idx - y1Idx);
        ntmpxy=-x1Idx * y2Idx + x2Idx * y1Idx;
        
        double dtmp2=(denominator*denominator/4.0+radiusDoub);
        
        //int i=0;
        int i=0,j=0,ntmp,ntmp2,ginhamIndex,ginhamIndex2;
        double dtmp1;
        for (i = top; i <= bottom; i++)
        {
            ntmp=i * width;
            ginhamIndex = (i/iScale)*iScale*width;
            j=0;
            for (j = left; j <= right; j++)
            {
                dtmp1=(double)(ntmpy1 * j + ntmpx1 * i + ntmpxy);
                
                if (dtmp1<0.0)
                {
                    dtmp1=-dtmp1;
                }
                
                if (dtmp2<0.0)
                {
                    dtmp2=-dtmp2;
                }
                
                if ((((j - x1Idx) * (j - x1Idx) + (i - y1Idx) * (i - y1Idx)))< radiusDoub
                    || (((j - x2Idx) * (j - x2Idx) + (i - y2Idx) * (i - y2Idx))) < radiusDoub
                    || (( dtmp1 < radius*denominator)
                        &&(j-midx)*(j-midx)+(i-midy)*(i-midy)<dtmp2))
