int eraserLine2(unsigned char* src,unsigned char* canvas, int width, int height, int channels,
                int x1Idx, int y1Idx, int x2Idx, int y2Idx, float radius)
{
    if (src == 0||canvas==0|| width <= 0 || height <= 0)
        return -1;
    if (channels != 4)
        return -1;
    int startXpos, startYpos, endXpos, endYpos;
    
    
    float denominator = sqrt(
                             (y2Idx - y1Idx) * (y2Idx - y1Idx)
                             + (x1Idx - x2Idx) * (x1Idx - x2Idx));
    double midx=(x1Idx+x2Idx)/2.0;
    double midy=(y1Idx+y2Idx)/2.0;
    double radiusDoub=radius*radius;
    int left,right,top,bottom;

    
    if (x1Idx == x2Idx && y1Idx == y2Idx)
    {
        startXpos = x1Idx;
        endXpos = x2Idx;
        startYpos = y1Idx;
        endYpos = y2Idx;
        
        left=MIN(MAX(startXpos - radius, 0),width-1);
        right=MIN(MAX(endXpos + radius, 0),width-1);
        top=MIN(MAX(startYpos - radius, 0),height-1);
        bottom=MIN(MAX(endYpos + radius, 0),height-1);
        
        for (int i = top; i <= bottom; i++)
        {
            int ntmp=i * width;
            for (int j = left; j <= right; j++)
            {
                if ((((j - x1Idx) * (j - x1Idx) + (i - y1Idx) * (i - y1Idx)))
                    < radiusDoub)
                {
                    int ntmp2=(ntmp + j) * channels;
                    canvas[ntmp2] = src[ntmp2];
                    canvas[ntmp2 + 1] = src[ntmp2 + 1];
                    canvas[ntmp2 + 2] = src[ntmp2 + 2];
                }
            }
        }
    }
    else
    {

        
        if (x1Idx < x2Idx) {
            startXpos = x1Idx;
            endXpos = x2Idx;
        } else {
            startXpos = x2Idx;
            endXpos = x1Idx;
        }
        if (y1Idx < y2Idx) {
            startYpos = y1Idx;
            endYpos = y2Idx;
        } else {
            startYpos = y2Idx;
            endYpos = y1Idx;
        }
        
        left=MIN(MAX(startXpos - radius, 0),width-1);
        right=MIN(MAX(endXpos + radius, 0),width-1);
        top=MIN(MAX(startYpos - radius, 0),height-1);
        bottom=MIN(MAX(endYpos + radius, 0),height-1);
        
        int ntmpy1,ntmpx1,ntmpxy;
        ntmpx1=(x1Idx - x2Idx);
        ntmpy1=(y2Idx - y1Idx);
        ntmpxy=-x1Idx * y2Idx + x2Idx * y1Idx;
        
        double dtmp2=(denominator*denominator/4.0+radiusDoub);
        
        for (int i = top; i <= bottom; i++)
        {
            int ntmp=i * width;
            for (int j = left; j <= right; j++)
            {
                double dtmp1=(double)(ntmpy1 * j + ntmpx1 * i + ntmpxy);
                
                if (dtmp1<0.0)
                {
                    dtmp1=-dtmp1;
                }
                
                
                if (dtmp2<0.0)
                {
                    dtmp2=-dtmp2;
                }
                
                if ((
                         ((j - x1Idx) * (j - x1Idx) + (i - y1Idx) * (i - y1Idx)))
                    < radiusDoub
                    || (
                            ((j - x2Idx) * (j - x2Idx)
                             + (i - y2Idx) * (i - y2Idx))) < radiusDoub
                    || (( dtmp1 < radius*denominator)
                    &&(j-midx)*(j-midx)+(i-midy)*(i-midy)<dtmp2))
                {
                    int ntmp2=(ntmp+j)*channels;
                    canvas[ntmp2] = src[ntmp2];
                    canvas[ntmp2 + 1] = src[ntmp2 + 1];
                    canvas[ntmp2 + 2] = src[ntmp2 + 2];
                }
            }
        }
    }
    
    return 0;
}
